import Datas from '../data/data';
import Card from '../composants/Card';
impo

export default function Gallery() {

    return (
        <>
        <main className='gallery'>
            {Datas.map(data => {
                return (
                    <Card
                        key={data.id}
                        id={data.id}
                        title={data.title}
                        cover={data.cover}
                    />
                )
            })}
        </main>
        </>
    )
};
